import React from "react";
import styles from "./SingerCard.module.css";

const SingerCard = () => {
  return (
    <div className={styles.singerCard}>
      <img src={require("../../Assets/Images/singer_Card_Logo1.jpeg")} alt="" />
    </div>
  );
};

export default SingerCard;
